package utils

import (
	"encoding/hex"
	"testing"

	"github.com/stretchr/testify/require"
)

// test ParseBatchIndex
func TestParseBatchIndex(t *testing.T) {
	calldata := ""
	bs, err := hex.DecodeString(calldata)
	require.NoError(t, err)
	require.EqualValues(t, ParseParentBatchIndex(bs), 14203)
}

func TestParseFBatchIndex(t *testing.T) {
	// Test case 1: Original test case
	calldata := ""
	bs, err := hex.DecodeString(calldata)
	require.NoError(t, err)
	require.EqualValues(t, ParseFBatchIndex(bs), 13991)

	// Test case 2: Modify batch index
	err = SetFBatchIndex(bs, 13992)
	require.NoError(t, err)
	require.EqualValues(t, ParseFBatchIndex(bs), 13992)

	// Test case 3: Test with invalid calldata
	invalidCalldata := []byte{0x12, 0x34} // Too short
	require.EqualValues(t, ParseFBatchIndex(invalidCalldata), 0)

	// Test case 4: Test with large batch index
	err = SetFBatchIndex(bs, 999999)
	require.NoError(t, err)
	require.EqualValues(t, ParseFBatchIndex(bs), 999999)

	// Test case 5: Test with zero batch index
	err = SetFBatchIndex(bs, 0)
	require.NoError(t, err)
	require.EqualValues(t, ParseFBatchIndex(bs), 0)
}
